import React,{useContext} from 'react';
import './SmallCard.scss'
import CardsContent from "../../context/CardsContent"
const SmallCard = () => {
    const dataContext = useContext(CardsContent)
    return (
        <React.Fragment>
            {dataContext.smallcards.map(smalcard=>(
                <div key={smalcard.key} className="card-component"> 
                    <img src={smalcard.src} alt={smalcard.alt}/>    
                    <p className="card-component__title">{smalcard.title}</p>
                </div>
            ))}
        </React.Fragment>
    );
};

export default SmallCard;
